import './Header.css';

const Header = () => {
    return (
        <div className="container">
            <input type="text" className="searchbar"></input>
            <div>
                <button type="button">Jaipur</button>
                <button type="button">Mumbai</button>
                <button type="button">Goa</button>
            </div>
        </div>
    );
};

export default Header;
